INSERT INTO `konfigurasi` (`id`, `judul`, `about`, `running_text`, `disclaimer`, `timezone`, `gmt`, `logo`, `email`, `email2`, `email3`, `banner`) VALUES
(1, 'VICTORIA POOLS', '<span style=\"font-size: 10pt;\">Welcome to<span>&nbsp;</span><strong>Lotterypools</strong>, the world&rsquo;s most online lottery experience.<span>&nbsp;</span></span><br /><span style=\"font-size: 10pt;\"><strong>Lotterypoolstoday</strong><span>&nbsp;</span>was designed specifically for players to play it safe<span>&nbsp;</span></span><br /><br /><span style=\"font-size: 10pt;\"><strong>Lotterypoolstoday</strong><span>&nbsp;</span>was launched by WLA , one of the biggest lottery association<span>&nbsp;</span></span><br /><br /><span style=\"font-size: 10pt;\">Our lottery are easy to learn and fun to play.<span>&nbsp;</span></span><br /><br /><span style=\"font-size: 10pt;\"><strong>OUR GAMES ARE FAIR</strong></span><br /><br /><span style=\"font-size: 10pt;\">Lotterypoolstoday the most innovative and reliable playing software on the market, ensuring that the odds are always fair. We want our customers to be able to focus on our awesome games, without having to worry about performance issues. That&rsquo;s why we use only the finest lottery gaming technology.</span><br /><br /><span style=\"font-size: 10pt;\"><strong>Are online Lottery safe?<br /></strong></span><br /><span style=\"font-size: 10pt;\">Any legal online lottery is heavily regulated, with security being a chief concern in the licensing process. As such, any lottery that is properly licensed has demonstrated that they have the tools and ability to keep personal and financial information safe, as well as securely process financial transaction. For those looking for further details, a portion of every GDC review is dedicated to that lottery&rsquo;s safety and security.</span><br /><br /><span style=\"font-size: 10pt;\"><strong>How can you add and withdraw funds at online lotterys?</strong></span><br /><br /><span style=\"font-size: 10pt;\">Credit cards, bank transfers, and any number of digital payment services can be used at nearly all online lotterys. Some lotterys even accept more fringe payment options like Bitcoin, and new means of funding such as Pay By Phone are emerging all the time. For more in-depth analysis we have compiled the following resource guides:</span><br /><br /><span style=\"font-size: 10pt;\">To compile our recaps of each of these aspects our reviewers spend time digging into a site and exploring all the digital nooks and crannies they can find. This allows them to become intimately familiar with the workings of not only the site, but the company behind it (something that is supplemented with further web research).</span><br /><br /><span style=\"font-size: 10pt;\">When it comes to functionality and gameplay, we playtest games in a number of different categories, which allows us to form first-hand impressions on how the games operate that we can then pass on to consumers. Our combination of practical site usage and meticulous research into internet lotterys as well as the companies behind them allows us to provide readers with reviews that are both exhaustive and informative.</span><br /><br /><span style=\"font-size: 10pt;\"><strong>Our priority is ensuring an amazing experience for our users.</strong></span><br /><br /><span style=\"font-size: 10pt;\"><strong>24/7 CUSTOMER SUPPORT</strong></span><br /><br /><span style=\"font-size: 10pt;\">At Lotterypools, every player is treated like royalty. Our courteous expert customer support agents are always available to serve your needs. Our number one focus is making sure that our customers are having a fun and seamless experience. There is nothing more important to us than your happiness.</span><br /><br /><span style=\"font-size: 10pt;\"><strong>Tips for gambling safely</strong></span><br /><span style=\"font-size: 10pt;\">Gambling recreation is fun. Obsessive gambling is not!</span>', '', '<strong><span style=\"color: #000000; font-size: 10pt;\">What is responsible gambling?</span></strong><br /><br /><span style=\"color: #000000; font-size: 10pt;\">Responsible gambling is a set of rules and best practices, defined, regulated and supported by national gaming authorities and gaming organizations, with the aim to protect the players and establish optimal conditions for gambling activities.</span><br /><span style=\"color: #000000; font-size: 10pt;\">Whether you&rsquo;re:</span><br /><br /><strong><span style=\"color: #000000; font-size: 10pt;\">looking for ways to keep gambling fun,</span></strong><br /><br /><span style=\"color: #000000; font-size: 10pt;\">a regulator who is committed to establishing responsible gambling standards,</span><br /><span style=\"color: #000000; font-size: 10pt;\">a gambling operator or equipment manufacturer who wants industry guidance on your organization&rsquo;s responsible gambling program and tools or are interested in exploring the latest in gambling research</span><br /><br /><br /><span style=\"color: #000000; font-size: 10pt;\">Responsible gambling refers both to players and gambling organizations (Lottery, online casinos, etc.). On one hand, players should be aware of the dangers of gambling addiction and &ldquo;play responsibly&rdquo;. On the other hand, gaming organizations should offer fair games in a safe gaming environment, taking special care of issues like:</span><br /><br />\r\n<ul>\r\n<li style=\"text-align: left;\"><span style=\"color: #000000; font-size: 10pt;\">Vulnerable players</span></li>\r\n<li style=\"text-align: left;\"><span style=\"color: #000000; font-size: 10pt;\">Underage gambling</span></li>\r\n<li style=\"text-align: left;\"><span style=\"color: #000000; font-size: 10pt;\">Money laundering</span></li>\r\n<li style=\"text-align: left;\"><span style=\"color: #000000; font-size: 10pt;\">Information privacy</span></li>\r\n<li style=\"text-align: left;\"><span style=\"color: #000000; font-size: 10pt;\">Prompt and accurate customer payments</span></li>\r\n<li style=\"text-align: left;\"><span style=\"color: #000000; font-size: 10pt;\">Fair gaming</span></li>\r\n<li style=\"text-align: left;\"><span style=\"color: #000000; font-size: 10pt;\">Ethical and responsible marketing</span></li>\r\n</ul>\r\n<br /><span style=\"color: #000000; font-size: 10pt;\">As online casinos are constantly bringing more gambling options at our fingertips, than we ever knew existed, responsible gambling practices gain more importance. They are no longer recommendations, they are requirements.</span><br /><br /><br />\r\n<div class=\"r-main-section__sub-header\" bis_skin_checked=\"1\"><span style=\"font-size: 10pt;\"><strong><span style=\"color: #000000;\">&nbsp; How do I gamble responsibly?</span></strong></span><br /><br /></div>\r\n<ul>\r\n<li><span style=\"color: #000000; font-size: 10pt;\">View gambling as a form of entertainment and not a source of income.</span></li>\r\n<li><span style=\"color: #000000; font-size: 10pt;\">Only gamble what you can afford to lose. You can use&nbsp;Deposit Limits&nbsp;to help manage the amount of money you&nbsp; spend.</span></li>\r\n<li><span style=\"color: #000000; font-size: 10pt;\">Never chase your losses, as this can lead to problems.</span></li>\r\n<li><span style=\"color: #000000; font-size: 10pt;\">Monitor the amount of time you spend playing. You can use&nbsp;Reality Checks&nbsp;to remind yourself how long you have been logged into your account.</span></li>\r\n<li><span style=\"color: #000000; font-size: 10pt;\">Balance gambling with other activities. When gambling becomes your only form of entertainment you should stop and consider whether you are still having fun.</span></li>\r\n<li><span style=\"color: #000000; font-size: 10pt;\">Take regular breaks from gambling. Gambling continuously can cause you to lose track of time and perspective.</span></li>\r\n<li><span style=\"color: #000000; font-size: 10pt;\">Do not gamble when under the influence of alcohol or when you are upset or depressed, as it can impair decision- making.</span></li>\r\n<li><span style=\"color: #000000; font-size: 10pt;\">Think about how much time and money you spend gambling. You can track your activity using your&nbsp;Online Account History.</span></li>\r\n<li><span style=\"color: #000000; font-size: 10pt;\">Understand your chance of winning and&nbsp;how the product works.</span></li>\r\n<li><span style=\"color: #000000; font-size: 10pt;\">Know that if you ever need to talk to someone about problem gambling you can contact a problem gambling&nbsp;support organisation.</span></li>\r\n</ul>\r\n<br /><br />\r\n<div id=\"\" class=\"r-main-section-pod \" bis_skin_checked=\"1\">\r\n<div class=\"r-main-section-pod__title no-image\" bis_skin_checked=\"1\"><strong><span style=\"color: #000000; font-size: 10pt;\">Are you responsible?<br /><br /></span></strong></div>\r\n<div class=\"\" bis_skin_checked=\"1\">\r\n<div class=\"r-main-section-pod__text\" bis_skin_checked=\"1\"><span style=\"color: #000000; font-size: 10pt;\">We strongly believe that the only way to Lottery at <strong>Lotterypoolstoday&nbsp;</strong>is responsibly. For a small number of people gambling can have a harmful impact. If you have concerns about the way you gamble, answer our short&nbsp;Self-Assessment&nbsp;to help recognise if you have a gambling problem.</span></div>\r\n</div>\r\n</div>', 'Australia', 'GMT+8', 'logo.png', 'info@Lotterypoolstoday.com', '', '', 'banner.png');
